import React from 'react';
import AboutMe from './AboutMe';

function App() {
  const styles = {
    backgroundImage: `url('https://img.freepik.com/free-vector/pixel-art-mystical-background_52683-87349.jpg?w=1380&t=st=1692816512~exp=1692817112~hmac=37c0fa7cd47b498082e8df2aa9be06896dccb645ba95abe5e0e39b507d7543d8')`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    height: '100vh',
  };
  return (
    <div>
      <AboutMe />
    </div>
  );
}

export default App;
